import React from "react";
import axios from "axios";

function App() {
  const getQuote = () => {
    axios
      .get("http://api.quotable.io/random")
      .then((response) => {
        console.log(response);
      })
      .catch((error) => {
        console.log(error);
      });
  };

  return (
    <div className="App">
      <button onClick={getQuote}>Pegar Dados</button>
    </div>
  );
}

export default App;
